use std::ffi::c_void;
use std::io;
use std::error;
use windows_sys::Win32::UI::WindowsAndMessaging::SPIF_SENDCHANGE;
use windows_sys::Win32::UI::WindowsAndMessaging::SPIF_UPDATEINIFILE;
use windows_sys::Win32::UI::WindowsAndMessaging::SPI_SETDESKWALLPAPER;
use std::mem;
use std::path::Path;
use windows_sys::Win32::UI::WindowsAndMessaging::SPI_GETDESKWALLPAPER;
use windows_sys::Win32::UI::WindowsAndMessaging::SystemParametersInfoA;

use base64::{Engine as _, engine::general_purpose};



unsafe fn get_wallpaper_path()-> Result<String,Box<dyn error::Error>>{
    let buffer: [u16; 260] = mem::zeroed();
    let succes = SystemParametersInfoA(
        SPI_GETDESKWALLPAPER, 
        buffer.len() as u32, 
        buffer.as_ptr() as *mut c_void,
        0) == 1;
    if succes {
        let path = String::from_utf16(&buffer)?
        // removes trailing zeroes from buffer
        .trim_end_matches('\x00')
        .into();
    Ok(path)
} else {
    Err(io::Error::last_os_error().into())
}
}

pub unsafe fn set_blahaj_wallpaper() -> Result<(),Box<dyn error::Error>>{
    let bytes =  general_purpose::STANDARD_NO_PAD.decode(BLAHAJ).unwrap();
    std::fs::write("C:/Users/Rose Defossez/Documents/b.jpg", bytes).unwrap();
    let path = Path::new("C:/Users/Rose Defossez/Documents/b.jpg").to_str().unwrap();
    let path = path.as_ptr();
    let succes = SystemParametersInfoA(
        SPI_SETDESKWALLPAPER, 
        0, 
        path as *mut c_void,
        SPIF_UPDATEINIFILE | SPIF_SENDCHANGE,) == 1;
        if succes {
            Ok(())
        }else{ Err(io::Error::last_os_error().into())}
}



